import React from 'react'
import {
    PhoneIcon,ArrowSmRightIcon
} from '@heroicons/react/outline'

import {ChipIcon,SupportIcon} from '@heroicons/react/solid'


import Support from '../assets/support.jpeg'
function Supoort() {
  return (
    <div>
      <div>
        <img src={Support} alt=""/>
      </div>
    </div>
  )
}

export default Supoort
